polymer = """

""".strip()

from copy import deepcopy
import re
regex = re.compile("(?P<letter>[a-zA-Z])(?!(?P=letter))(?i:(?P=letter))")


for letter in "abcdefghijklmnopqrstuvwxyz":
    data = deepcopy(polymer)
    data = data.replace(letter, "")
    data = data.replace(letter.upper(), "")
    prev_data = None
    while prev_data != data:
        prev_data = deepcopy(data)
        data = regex.sub('', data)
    print(letter, len(data))
